package com.zhzx.dao.model.prod;import com.zhzx.dao.model.BaseModel;public class ProdPropertyModel extends BaseModel {	/**	 *商品属性编号	 */	private String id;	/**	 *商品编号	 */	private String prodNo;	/**	 *属性key	 */	private String propKey;	/**	 *属性名称	 */	private String propName;	/**	 *属性值	 */	private String propValue;	/**	 *属性描述	 */	private String propDiscribe;	/**	 *属性扩展字段	 */	private String extend;	/**	 *属性状态（有效：1，无效0）	 */	private String status;	public String getId() {		return this.id;	}	public void setId(String id) {		this.id=id;	}	public String getProdNo() {		return this.prodNo;	}	public void setProdNo(String prodNo) {		this.prodNo=prodNo;	}	public String getPropKey() {		return this.propKey;	}	public void setPropKey(String propKey) {		this.propKey=propKey;	}	public String getPropName() {		return this.propName;	}	public void setPropName(String propName) {		this.propName=propName;	}	public String getPropValue() {		return this.propValue;	}	public void setPropValue(String propValue) {		this.propValue=propValue;	}	public String getPropDiscribe() {		return this.propDiscribe;	}	public void setPropDiscribe(String propDiscribe) {		this.propDiscribe=propDiscribe;	}	public String getExtend() {		return this.extend;	}	public void setExtend(String extend) {		this.extend=extend;	}	public String getStatus() {		return this.status;	}	public void setStatus(String status) {		this.status=status;	}}